import React from "react";
import Footer from "../components/Footer";
import GreenButton from "../components/GreenButton";
import Navbar from "../components/Navbar";
import "./about.css";
function About() {
  return (
    <>
      <Navbar />
      <main>
        <section className="container">
          <h2 className="home_title">About Us</h2>
          <p className="aboutus_desc">
            Code with Kashyap largest shareholders are Nexus Venture Partners and
            Sequoia India, which holds 13.1% each of the company's shares.
            Around 14.4% of code  shares are in its ESOP pool. Softbank,
            General Atlantic and more form the other shareholders of the
            company. Unacademy Co-founders - Gaurav Munjal, Roman Saini and
            Hemesh Singh together retain over 9% stakes in Unacademy.
          </p>
          <div className="aboutus_button">
            <GreenButton link="/courses" text="Contact Us" />
          </div>
        </section>
      </main>
      <Footer />
    </>
  );
}

export default About;
